class DynamicSuite{static call(e,t,a){fetch(`/dynamicsuite/api/${e}`,{method:"POST",body:JSON.stringify(t||[])}).then(e=>{if(e.ok)return e;throw new Error("A server error has occurred")}).then(e=>e.json()).then(e=>a(e),()=>a({status:"SERVER_ERROR",message:"A malformed response was returned",data:null})).catch(e=>{console.log(e),a({status:"SERVER_ERROR",message:"A malformed response was returned",data:null})})}}DynamicSuite.vm=new Vue({name:"DynamicSuite",el:"#dynamicsuite",data:()=>({has_session:!1,hide_overlay:!0,overlay_nav_tree:null,overlay_nav_header_text:null,overlay_nav_header_view:null,overlay_nav_footer_text:null,overlay_nav_footer_view:null,overlay_title:null,overlay_actions:null}),computed:{content_classes(){return{overlay:!this.hide_overlay}}},mounted(){if("object"==typeof window.dynamicsuite){for(const e of Object.keys(this._data))void 0!==window.dynamicsuite[e]&&(this[e]=window.dynamicsuite[e]);document.getElementById("dynamicsuite").style.display="flex",document.getElementById("ds-content").style.display="flex"}}});Vue.component("ds-overlay",{template:'<div id="ds-overlay"><div id="ds-nav-button" class="interactive button" @click="toggleNav"><i class="fas fa-bars"></i></div><h1 id="ds-title" class="clip-text centered">{{$root.overlay_title}}</h1><div id="ds-actions-button" class="interactive button"><i class="fas fa-user"></i></div><div id="ds-nav" :class="nav_classes"><header class="interactive clip-text centered" @click="goto($root.overlay_nav_header_view)">{{$root.overlay_nav_header_text}}</header><nav>Nav</nav><footer class="interactive clip-text centered" @click="goto($root.overlay_nav_footer_view)">{{$root.overlay_nav_footer_text}}</footer></div></div>',data:()=>({show_nav:!1}),computed:{nav_classes(){return{show:this.show_nav}}},methods:{goto(t){document.location=t},toggleNav(){this.show_nav=!this.show_nav}},mounted(){document.getElementById("ds-content").addEventListener("click",()=>{this.show_nav=!1})}});